import React from 'react'
import Tooltips from '../../../Tooltips/Tooltips.jsx'
//import{ CSSTransition } from 'react-transition-group'


export default class BinarySearchTreeTooltips extends Tooltips {
    getContent() {
        switch( this.state.operation ) {
            case 'Generate':    return this.GenerationTooltips();
            case 'Reset':       return this.ResetTooltips();
            case 'Insert':      return this.InsertionTooltips();
            case 'Remove':      return this.RemovalTooltips(); 
            case 'Search':      return this.SearchTooltips();
            case 'Pre-Order':
            case 'In-Order':
            case 'Post-Order':
            case 'Level Order': return this.TraversalTooltips();
            case 'Initial':
            default:            return this.InitialTooltips();
        }
    }

    GenerationTooltips() {
        return (
            <>
                {'Generation'}
            </>
        );
    }

    ResetTooltips() {
        return (
            <>
                {'reset'}
            </>
        );
    }

    InsertionTooltips() {
        return (
            <>
                {'insert'}
            </>
        );
    }

    RemovalTooltips() {
        return (
            <>
                {'Remove'}
            </>
        );
    }

    SearchTooltips() {
        return (
            <>
                {'Search'}
            </>
        );
    }

    TraversalTooltips() {
        return (
            <>
                {'Traversal'}
            </>
        );
    }

    InitialTooltips() {
        return (
            <>
                {'Initial'}
            </>
        );
    }
}
